import React from 'react';
import './App.css';
import NavBar from "./components/Navbar";
import JumboTron from "./components/Jumbotron";

function App() {
  return (
    <div 
    className="App"
    >
    <NavBar>
      <JumboTron>
        this is a test
      </JumboTron>

    </NavBar>
    </div>
  );
}

export default App;
